import React from 'react';

const Navigation = ({onRouteChange, initialstate}) => {
    if (initialstate === false){
    return (
    <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
    <p onClick={() => onRouteChange("rollAgain")} className='f5 link dib black fcdxs underline pa3 pointer' > Roll Again?</p>
    </nav>
     )} else{
      return(
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
          <p onClick={() => onRouteChange('signin')} className='f5 link dib  underline pa3 pointer' > Sign in </p>
          <p onClick={() => onRouteChange('register')} className='f5 link dib  underline pa3 pointer' > Register </p>
         </nav>



        )



    }

};




export default Navigation;
